B.Bd=new A.bY("Hi, Welcome to my internet home :) Here you will find a little snippet of my nerdy self!\n\nIf you landed here without knowing me at all, here is a little something.\n\nI worked as a software developer in Google Summer of Code 2021 for 52North GmbH, where I did semi-cool stuff and built a cross-platform mobile application. From there onwards I interned at Amadeus for 5 months as a software engineer and also returned to Google Summer of Code 2022 but as a mentor this time. While mentoring students and managing the project, I quickly realised, I was intrigued by other parts of the business than engineering. So I researched and read a lot about other roles eventually settling on Product Management.\n\nI love plotting graphs and knowing what the users were trying to achieve, but I also love talking to the real users. So while I can be rigid about data, I am also BIG on communication. I think this is exactly why I am extremely cross-functional, collaborative and voice of the customer! I am constantly looking to learn, so I always try and read a little and write sporadically. I also love analysing other apps, finding where they could improve and what new features they can launch that would solve their customers\u2019 problems.\n\nIf you read this long, thank you very much for bearing with me and my weird journey so far. I hope to connect with all my readers one way or another and learn from them, so feel free to reach out to me.",null,null)
