B.B7=new A.bY("When solving a problem, first principle thinking involves dissecting the issue into its component elements and then reassembling them to find a workable answer.\n\nFirst principle thinking is beneficial to PMs as businesses grow because it makes it easier to explain to their team and stakeholders the reasoning behind past, present, and future decisions. This makes it possible for those close to the PM to act fast, disconnect, and make wise decisions without their presence.\n\nElon Musk intended to develop rockets so that he could one day send people to MARS. To find out how much it would cost to make rockets, he visited various rocket-building organisations. He was surprised to learn that rockets were a big thing and that prices for a single rocket might reach 65 million dollars.\n\nHe disassembled a rocket into its component elements by thinking in terms of first principles. titanium, copper, carbon fibre, and aluminium alloys suitable for use in aerospace.\n\nHe continued to commodity markets in quest of these ingredients and discovered that the necessary quantity could be purchased for about 2% of the going rate.\n\nMusk decided to start his own rocket company, SpaceX, rather than spending millions on purchasing rockets from third parties.\n\nFor anyone, using first principles can transform the game.\n\nIt creates fresh doors and opportunities.\n\nIt enables you to analyse the current situation critically and propose honourable remedies.\n\nWhen you start merging fundamental elements from two separate systems to develop a completely new value proposition, the true power of first principles becomes apparent.",null,null)
B.Dc=new A.dp("Applying First Principles in our Life",null)
B.B3=new A.bY("By responding to circumstances in the following ways, you can incorporate first principles into your life:\n\n- Dissect systems into their component elements. A system could be a circumstance, a difficulty, or even a device.\n- Combine the component components of other systems to produce something wholly original and worthwhile.\n- Analogies and hasty deductions should be questioned.",null,null)
