B.D8=new A.eG("Don't Listen to your Customers!",null,null,null,null,null)
B.AW=new A.bY("\u201cIf I had asked people what they wanted, they would have said faster horses.\u201d\n~ Henry Ford\n\nThe first and probably the most important rule when building a product is -\n\n\u201cListen to your customers\u201d\n\nBut what must we listen to from the customers?\n\nA lot of people think listening to customers means simply asking them what they want. But unfortunately, people do not know what they want.\n\nBecause they have no idea how advanced today's technology is and what is possible with it.\n\nBefore Facebook, probably no customer in the world would have been able to describe anything even remotely close to Facebook's idea. Even if it were exactly what they needed.\n\nSimply because nothing like that ever existed before and people back then didn't know what was possible with the internet and the technology.\n\nIf that's the case then why must you talk to customers if they can't even say what they want?\n\nBecause \"listening to customers\" never meant asking them what they want. It meant asking what problems they were facing in their day to day life.\n\nSo, if you were making an instant grocery delivery app, instead of asking -\n\u201cDo you want yet another grocery delivery app that will deliver your order in under 10 minutes?\u201d\n\n(To which the customers will most definitely say yes because\u2026. well it's not gonna cost them to)\n\nYou must ask -\n\u201cWhat are the problems that you face while using existing grocery delivery apps?\u201d\n\nAnd someone who uses these apps extensively would most definitely say that their groceries take a long time to get delivered and they wish to receive them sooner.\n\n(They won't exactly say they want them in 10 minutes because\u2026 customers don't know what they want!)\n\nSo, the next time when you're talking to your customers, don't ask them what they want.\n\nAsk them what problems they are facing and work your way to the solution from there.\n\nAfter all that's what customers pay you for, building solutions.",null,null)
