B.D4=new A.eG("Product Roadmap",null,null,null,null,null)
B.AS=new A.bY("A product roadmap is a high-level visual description that shows how your product offering will develop over time. A product roadmap explains the goals and motivations behind the things you're creating. A roadmap serves as both a plan for carrying out the product strategy and a guiding strategic document.\n\nThe product plan contains the following ultimate objectives:\n- Describe the goals and plan.\n- Create a manual for carrying out the approach.\n- Bring internal stakeholders together\n- Encourage option debate and scenario preparation\n- Aid in facilitating communication with external parties, such as clients\n\nThe strategic direction for your product should be clear from your product plan. Additionally, it must to relate back to the business plan. Of course, the general structure of what you'll be developing is contained within that framework.\n\nIt may be simpler to obtain executive buy-in if the product vision and strategy are clearly stated. Additionally, it guarantees that everyone is pursuing the same objective.",null,null)
B.Dd=new A.dp("Product Roadmap Evolution",null)
B.AR=new A.bY("Product roadmaps also undergo their own change. A roadmap for a brand-new MVP differs dramatically from one for an established product on a number of levels:\n\nHorizon:  Startups find it considerably more difficult to anticipate customer needs and business prospects. They probably won't plan out very far into the future, or if they do, it will be with a lot of big asterisks. Longer-term plans can be more firmly made for established products. They are more knowledgeable about the market and their customers.\n\nFrequency:  You need to \"always be shipping\" when you're young and feisty. Releases of more developed products can be spaced out with less haste.\n\nDependencies:  New businesses can move swiftly and ruin things. Regression problems, legacy concerns, and third-party integration maintenance are all issues that mature products must deal with.\n\nGoals:  Compared to enterprise products, a startup's goals are quite different. The first is merely attempting to establish its viability, gather some momentum, and expand. The latter will have more complex strategic goals and a broader range of targets.",null,null)
