B.B8=new A.bY("One of the most important aspects of a product manager's work is deciding what to build. There are only so many opportunities to have an effect. So it's essential to make informed decisions and take advantage of your window of opportunity. When establishing priorities for your product, there are numerous things to take into account. But you must put real client problems at the top of your priority list. Organizations all too frequently fail to adhere to this fundamental principle of product creation, maybe as a result of placing value before innovation. We all want to be viewed as trailblazers in our fields, but that's not always what the market wants. Sometimes they only want to make slight adjustments to things that are already working. It is preferable to emphasise allocating resources on reducing friction points and making things a little simpler rather than searching for the ultimate gamechanger.",null,null)
B.Dm=new A.dp("ICE Scoring",null)
B.Be=new A.bY("Product managers may swiftly evaluate competing efforts using the ICE scoring methodology by giving each one a score based on the three factors of impact, confidence, and convenience. ICE score is intended to assist product teams in quickly deciding which projects to accept so they can get to work. However, it lacks the rigour of other frameworks like weighted scoring.",null,null)
B.Dp=new A.dp("Benefit vs. Cost (Weighted Scoring)",null)
B.B2=new A.bY('Product managers prioritise initiatives using the weighted scoring prioritisation framework in accordance with standard cost-vs-benefit criteria. For example, "raise income" under benefits and "implementation effort" under expenses are given scores by the team. For those factors that it considers to be more important than others, the team can produce higher overall scores. In this picture, a team is demonstrating how to score the relative strategic value of seven competing product initiatives using six scoring criteria\u2014three benefits and three costs.',null,null)
B.Db=new A.dp("RICE Scoring",null)
B.Bb=new A.bY("By assigning points for each item on a product roadmap based on the four criteria of reach, impact, confidence, and effort, the RICE scoring framework aids product teams in prioritising their priorities. Each initiative will receive a single score to gauge its relative worth to the product and the company once the team adds its total scores for all of the initiatives across all four categories.",null,null)
B.Dk=new A.dp("Scaled Agile Framework (SAFe)",null)
B.AU=new A.bY("The scaled agile framework (SAFe), a widely used technique in large corporations, is intended to guard against the typical difficulties big businesses encounter as their agile teams grow. This top-down decision-making framework focuses on the team, programme, and portfolio components of development.",null,null)
B.De=new A.dp("AARRR",null)
B.B4=new A.bY("AARRR is a five-step framework specifically created to assist new businesses in growing. The term was created by venture capitalist Dave McClure and represents the five important KPIs that, in his opinion, every business should prioritise. These include acquisition, activation (the user's first interaction with the product), retention, referrals, and income.",null,null)
B.Df=new A.dp("Choosing the Right Framework",null)
B.B6=new A.bY("Choosing a product priority strategy may seem difficult given the abundance of possibilities. There is undoubtedly a lot to think about. However, the existence of so many frameworks is due to the fact that many businesses have varied demands, depending on the size of the business, the maturity of the product, or the culture of the product development organisation. To find out which prioritisation framework product managers preferred, see our most recent report.",null,null)
B.FO=A.b(s([B.D2,B.B8,B.Dm,B.Be,B.Dp,B.B2,B.Db,B.Bb,B.Dk,B.AU,B.De,B.B4,B.Df,B.B6]),t.p)
