B.Da=new A.eG("Agile Product Development",null,null,null,null,null)
B.AV=new A.bY("We live in a period of change. Within a year or two, concepts might transform from being viable to non-starters (and vice versa) due to changes in technology and client preferences.\n\nIn this situation, you need to produce products quickly and acurately. However, the conventional guidelines for product development were created in a totally different time period and may be inapplicable now.\n\nIn the conventional product development approach, you would begin by thoroughly studying your idea and outlining your suggested solution, coming up with a rigorous set of requirements, building the entire thing from scratch, launching it, and then beginning to gather user feedback.\n\nThat was reasonable at the time because it was expensive to produce physical goods and difficult to obtain ongoing client feedback.\n\nHowever, there is a chance that you will spend so much time planning and creating your product that it will be outdated before it even touches the market. Additionally, since feedback from customers only comes in at the very end, you can simply design something that satisfies all the requirements but isn't what consumers want.",null,null)
B.Dl=new A.dp("Put the Customer First",null)
B.B0=new A.bY("Agile product development avoids the need to start from scratch and provide clients with the final product.\n\nInstead, you divide the project into manageable chunks. You begin small, attracting potential clients by employing the strategies outlined in the last session and providing them with access to useful, functional software as you create it. As soon as your consumers are pleased, you may use their comments to help you build the following component in a way that will be most beneficial to them.\n\nYou might start by releasing a minor component that allows users to choose which Twitter followers to unfollow if your end product is a comprehensive software suite that assists consumers in managing all of their various social media profiles.\n\nYour customers can hear about your broad concept for the entire package from you while offering them something to utilise right away accomplishes two goals -\n\n1. While they wait for the finished product, it makes them joyful.\n2. For you to not waste time creating items that people won't like or want, it provides you with insightful feedback on the layout and features of your product.",null,null)
B.FU=A.b(s([B.Da,B.AV,B.Dl,B.B0]),t.p)
B.FV=A.b(s(["pointerdown","pointermove","pointerleave","pointerup","pointercancel","touchstart","touchend","touchmove","touchcancel","mousedown","mousemove","mouseleave","mouseup","wheel"]),t.s)
B.D7=new A.eG("Prioritizing Product Backlog",null,null,null,null,null)
B.B5=new A.bY("We all set priorities in our daily lives because we only have so much time to complete each set of tasks. As a result, we choose to carry out the most crucial tasks first, followed by the less critical ones. In software development, we prioritise tasks or functionality because some features are more crucial than others.\n\nSimilar to this, one of the most crucial activities in agile software development is product backlog prioritisation. Any project is successful if the clients, stakeholders, or company receives the most important feature first. And doing so will depend on how well and consistently the needs are prioritised. Backlog prioritising is necessary to organise the product backlog items to make the sequence of its development and deployment. The scrum team uses this sequence when selecting product backlog items for grooming or sprint planning.\n\nAlthough there are different criteria for each product, the following common factors can be summarised as contributing factors for product backlog item prioritisation:\n1. Customer Satisfaction\n2. Business Value\n3. Complexity\n4. Risk & Opportunity\n5. Cost",null,null)
B.Do=new A.dp("1. Customer Satisfaction",null)
B.B9=new A.bY("We consistently give functionality (backlog items) with a high likelihood of greater customer satisfaction a high priority in order to prioritise stories while keeping the factor of customer satisfaction in mind. and give that functionality first priority; else, customers can be unhappy.",null,null)
B.Dn=new A.dp("2. Business Value",null)
B.AY=new A.bY("Prioritizing the functionality depends heavily on understanding the business strategy and aim. The ideal person to prioritise items on the product backlog is therefore the product owner or the business analyst. Prioritizing the product backlog item can be done by determining which functionality will be most valuable in achieving the business objective. The company value is influenced by the sponsor, sales team, or strategic thinker by focusing on long-term advantages or instant value addition to outperform rivals.",null,null)
B.Di=new A.dp("3. Cost to Develop",null)
B.Ba=new A.bY("High expenses may not always be low priority; we must consider the cost and return on investment of each functionality. Cost is not the only consideration; we also need to consider the functionality's return when setting priorities. Undoubtedly, low cost and high return will be priorities, and vice versa. A low priority could be high cost/poor return. But taking into account other variables of prioritisation, High Cost - High Return may also be at the top of the list.",null,null)
B.Dh=new A.dp("4. Risks",null)
B.AX=new A.bY("Maximizing early mitigation requires placing functions with high risks at the top of the list. Whereas delaying the development of high-risk functionality increases the total risk of the project.",null,null)
B.Dg=new A.dp("5. Complexity",null)
B.AT=new A.bY("It is recommended to begin working on functionalities with high complexity or difficulty in the early phases of the project. As the team is young, it is simple to assign the skilled and experienced people. And If it takes more time than estimated, the team will also have more room to adjust the extra time.",null,null)
B.FW=A.b(s([B.D7,B.B5,B.Do,B.B9,B.Dn,B.AY,B.Di,B.Ba,B.Dh,B.AX,B.Dg,B.AT]),t.p)
